declare module "google-spreadsheet" {
    export default class GoogleSpreadsheet {
        constructor(dockey: string);
        updateGoogleSheets(sheetName: string, array2D: any[][]): Promise<{
            url: string;
            gid: number;
        }>;
        useServiceAccountAuth(options: any, callback: (err: Error) => void): void;
        getInfo(callback: (err: Error, docInfo: DocInfo) => void): void;
        addWorksheet(options: any, callback: (err: Error, sheet: SpreadsheetWorksheet) => void): void;
    }
    type DocInfo = {
        worksheets: SpreadsheetWorksheet[];
    };
    type SpreadsheetWorksheet = {
        id: string;
        title: string;
        rowCount: number;
        colCount: number;
        resize: (options: any, callback: (err?: Error) => void) => void;
        getCells: (options: any, callback: (err: Error, cells: any[]) => void) => void;
        bulkUpdateCells: (data: any[], callback: (err: Error) => void) => void;
    };
}
